import ApiIntegration from "./pages/ApiIntegration.jsx"
function App() {
  return (
    <Router>
      <Link></Link>
      <Link></Link>
      <Link></Link>
      <Link></Link>
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Routes path="/advance-react" element={<StateManagement/>}/>
        <Routes path="/forms-and-validation" element={<FormsAndValidation/>}/>
        <Routes path="/hooks" element={<Hooks/>}/>
        <Routes path="/api-integration" element={<ApiIntegration/>}/>
      </Routes>
    </Router>
  );
}

export default App;
